BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `various` (
	`idvarious`	int ( 11 ) NOT NULL,
	`nextorder_number`	int ( 11 ) DEFAULT NULL,
	`nextdoc_number`	int ( 11 ) DEFAULT NULL,
	`nextextorder_number`	int ( 11 ) DEFAULT NULL,
	`nextprod_number`	int ( 11 ) DEFAULT NULL
);
CREATE TABLE IF NOT EXISTS `users` (
	`iduser`	INTEGER,
	`username`	VARCHAR ( 50 ) NOT NULL,
	`firstname`	VARCHAR ( 100 ),
	`lastname`	VARCHAR ( 100 ),
	`credential_hash`	VARCHAR ( 200 ),
	`authentication_level`	INT NOT NULL,
	`state`	VARCHAR NOT NULL,
	PRIMARY KEY(`iduser`)
);
CREATE TABLE IF NOT EXISTS `text` (
	`idtext`	int ( 11 ) NOT NULL,
	`idcustomkey`	int ( 11 ) DEFAULT NULL,
	`text`	varchar ( 200 ) DEFAULT NULL,
	`placeholders`	varchar ( 200 ) DEFAULT NULL,
	`category`	varchar ( 45 ) DEFAULT NULL
);
CREATE TABLE IF NOT EXISTS `stockparts` (
	`idstockparts`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idproduct`	int ( 11 ) DEFAULT NULL,
	`amount`	decimal ( 10 , 3 ) DEFAULT NULL,
	CONSTRAINT `fk_idproduct_sp` FOREIGN KEY(`idproduct`) REFERENCES `company`(`idcompany`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `shipper` (
	`idshipper`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`name`	varchar ( 45 ) DEFAULT NULL,
	`weight_kg`	decimal ( 8 , 3 ) DEFAULT NULL,
	`price`	decimal ( 8 , 2 ) DEFAULT NULL,
	`tax`	decimal ( 5 , 2 ) DEFAULT NULL,
	`maximaldist_km`	int ( 11 ) DEFAULT NULL
);
CREATE TABLE IF NOT EXISTS `rawmaterial` (
	`idrawmaterial`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`material`	varchar ( 50 ) DEFAULT NULL,
	`dimension`	varchar ( 50 ) DEFAULT NULL,
	`amount_unit`	text DEFAULT NULL,
	`orderlength`	decimal ( 10 , 3 ) DEFAULT NULL,
	`orderweight_kg`	decimal ( 7 , 3 ) DEFAULT NULL,
	`order_threshold_min`	decimal ( 7 , 3 ) DEFAULT NULL,
	`price_per_orderentity`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_per_orderentity_min`	decimal ( 8 , 2 ) DEFAULT NULL,
	`description`	varchar ( 60 ) DEFAULT NULL,
	`density_kgm3`	decimal ( 10 , 4 ) DEFAULT NULL,
	`idsupplier`	int ( 11 ) DEFAULT NULL,
	`idsupplieraddress`	int ( 11 ) DEFAULT NULL,
	`idsuppliercontact`	int ( 11 ) DEFAULT NULL,
	`instock`	decimal ( 10 , 3 ) DEFAULT NULL,
	`ordered`	decimal ( 10 , 3 ) DEFAULT NULL,
	`date_lastordered`	date DEFAULT NULL,
	`date_lastused`	date DEFAULT NULL,
	CONSTRAINT `fk_idsupplier_rw` FOREIGN KEY(`idsupplier`) REFERENCES `company`(`idcompany`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idsuppliercontact_rw` FOREIGN KEY(`idsuppliercontact`) REFERENCES `companycontact`(`idcompanycontact`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idsupplieraddress_rw` FOREIGN KEY(`idsupplieraddress`) REFERENCES `companyaddress`(`idcompanyaddress`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `product` (
	`idproduct`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idcustomer`	int ( 11 ) DEFAULT NULL,
	`name`	varchar ( 100 ) DEFAULT NULL,
	`supplier_prodno`	varchar ( 45 ) DEFAULT NULL,
	`supplier_drawno`	varchar ( 45 ) DEFAULT NULL,
	`idreplaced_by`	int ( 11 ) DEFAULT NULL,
	`replaced_by_date`	date DEFAULT NULL,
	`type`	text DEFAULT NULL,
	`amount_unit`	varchar ( 10 ) DEFAULT NULL,
	`idparentproduct`	int ( 11 ) DEFAULT NULL,
	`idsupplieraddress`	int ( 11 ) DEFAULT NULL,
	`supplier_price`	decimal ( 8 , 2 ) DEFAULT NULL,
	`time_setup_min`	decimal ( 6 , 2 ) DEFAULT NULL,
	`time_prodperpart_min`	decimal ( 6 , 2 ) DEFAULT NULL,
	`length_rawmaterial_beforesawn_mm`	decimal ( 8 , 3 ) DEFAULT NULL,
	`idrawmaterial`	int ( 11 ) DEFAULT NULL,
	`length_rawmaterial_mm`	decimal ( 8 , 3 ) DEFAULT NULL,
	`price_rawmaterial`	decimal ( 8 , 2 ) DEFAULT NULL,
	`idproduction`	int ( 11 ) DEFAULT NULL,
	`external_costs_sum`	decimal ( 8 , 2 ) DEFAULT NULL,
	`external_time_sum_d`	decimal ( 6 , 2 ) DEFAULT NULL,
	`parts_instock`	decimal ( 6 , 0 ) DEFAULT NULL,
	`parts_inorder`	decimal ( 6 , 0 ) DEFAULT NULL,
	`price_set_per_piece`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_set_initial`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_calc_per_piece`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_calc_initial`	decimal ( 8 , 2 ) DEFAULT NULL,
	`weight_kg`	decimal ( 8 , 3 ) DEFAULT NULL,
	`dimension_lwh_mm`	varchar ( 20 ) DEFAULT NULL,
	`comment_order`	varchar ( 200 ) DEFAULT NULL,
	`comment_production`	varchar ( 200 ) DEFAULT NULL,
	`comment_external`	varchar ( 200 ) DEFAULT NULL,
	`idcopied_from`	int ( 11 ) DEFAULT NULL,
	`date_lastproduced`	date DEFAULT NULL,
	`date_created`	date DEFAULT NULL,
	`date_changed`	date DEFAULT NULL,
	CONSTRAINT `fk_idrawmaterial_pd` FOREIGN KEY(`idrawmaterial`) REFERENCES `rawmaterial`(`idrawmaterial`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idsupplieraddress_pd` FOREIGN KEY(`idsupplieraddress`) REFERENCES `companyaddress`(`idcompanyaddress`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idcopied_from_pd` FOREIGN KEY(`idcopied_from`) REFERENCES `product`(`idproduct`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idcustomer_pd` FOREIGN KEY(`idcustomer`) REFERENCES `company`(`idcompany`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `prodoperation` (
	`idprodoperation`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idproduct`	int ( 11 ) DEFAULT NULL,
	`type`	text DEFAULT NULL,
	`idsupplier`	int ( 11 ) DEFAULT NULL,
	`idsupplieraddress`	int ( 11 ) DEFAULT NULL,
	`idsuppliercontact`	int ( 11 ) DEFAULT NULL,
	`operationindex`	int ( 11 ) DEFAULT NULL,
	`name`	varchar ( 60 ) DEFAULT NULL,
	`description1`	varchar ( 100 ) DEFAULT NULL,
	`description2`	varchar ( 100 ) DEFAULT NULL,
	`idshipper`	int ( 11 ) DEFAULT NULL,
	`price_shipper_delivery`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_shipper_per_piece`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_initial`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_per_piece`	decimal ( 8 , 2 ) DEFAULT NULL,
	`returntime_d`	decimal ( 6 , 2 ) DEFAULT NULL,
	`time_setup_min`	decimal ( 6 , 2 ) DEFAULT NULL,
	`time_per_piece_min`	decimal ( 6 , 2 ) DEFAULT NULL,
	`parallelworkdelay_min`	decimal ( 6 , 2 ) DEFAULT NULL,
	CONSTRAINT `fk_idextcompanycontact_po` FOREIGN KEY(`idsuppliercontact`) REFERENCES `companycontact`(`idcompanycontact`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idsupplier_po` FOREIGN KEY(`idsupplier`) REFERENCES `company`(`idcompany`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idproduct_po` FOREIGN KEY(`idproduct`) REFERENCES `product`(`idproduct`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idshipper_po` FOREIGN KEY(`idshipper`) REFERENCES `shipper`(`idshipper`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idextcompanyaddress_po` FOREIGN KEY(`idsupplieraddress`) REFERENCES `companyaddress`(`idcompanyaddress`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `orderdetailop` (
	`idorderdetailop`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idorder`	int ( 11 ) DEFAULT NULL,
	`idorderdetail`	int ( 11 ) DEFAULT NULL,
	`idproduct`	int ( 11 ) DEFAULT NULL,
	`idprodoperation`	int ( 11 ) DEFAULT NULL,
	`operationindex`	int ( 11 ) DEFAULT NULL,
	`state`	text DEFAULT NULL,
	`date_plannedstart`	date DEFAULT NULL,
	`date_prepared`	date DEFAULT NULL,
	`date_extsent`	date DEFAULT NULL,
	`date_expectedback`	date DEFAULT NULL,
	`date_extback`	date DEFAULT NULL,
	`date_done`	date DEFAULT NULL,
	`name`	varchar ( 60 ) DEFAULT NULL,
	`type`	text DEFAULT NULL,
	`planningdata`	varchar ( 50 ) DEFAULT NULL,
	`amount`	decimal ( 8 , 2 ) DEFAULT NULL,
	CONSTRAINT `fk_idproduct_1` FOREIGN KEY(`idproduct`) REFERENCES `product`(`idproduct`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idorder_1` FOREIGN KEY(`idorder`) REFERENCES `order`(`idorder`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idorderdetail_1` FOREIGN KEY(`idorderdetail`) REFERENCES `orderdetail`(`idorderdetail`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `orderdetail` (
	`idorderdetail`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idorder`	int ( 11 ) DEFAULT NULL,
	`idproduct`	int ( 11 ) DEFAULT NULL,
	`idrawmaterial`	int ( 11 ) DEFAULT NULL,
	`name`	varchar ( 100 ) DEFAULT NULL,
	`supplier_prodno`	varchar ( 45 ) DEFAULT NULL,
	`supplier_drawno`	varchar ( 45 ) DEFAULT NULL,
	`amount`	decimal ( 8 , 2 ) DEFAULT NULL,
	`amount_unit`	varchar ( 10 ) DEFAULT NULL,
	`amount_from_stock`	decimal ( 8 , 2 ) DEFAULT NULL,
	`tax`	decimal ( 5 , 2 ) DEFAULT NULL,
	`comment_offer`	varchar ( 200 ) DEFAULT NULL,
	`comment_production`	varchar ( 200 ) DEFAULT NULL,
	`comment_invoice`	varchar ( 200 ) DEFAULT NULL,
	`comment_external`	varchar ( 200 ) DEFAULT NULL,
	`comment_delivery`	varchar ( 200 ) DEFAULT NULL,
	`length_rawmaterial_beforesawn_mm`	decimal ( 8 , 3 ) DEFAULT NULL,
	`length_rawmaterial_order_mm`	decimal ( 8 , 3 ) DEFAULT NULL,
	`price_internal`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_externalop`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_reduction_perc`	decimal ( 5 , 2 ) DEFAULT NULL,
	`price_reduction_abs`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_customer`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_currencystr`	varchar ( 10 ) DEFAULT NULL,
	`price_initial_notax`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_per_piece_notax`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_average_per_piece`	decimal ( 8 , 2 ) DEFAULT NULL,
	`time_production_min`	decimal ( 6 , 2 ) DEFAULT NULL,
	`units_fromstock`	decimal ( 5 , 0 ) DEFAULT NULL,
	`units_toproduce`	decimal ( 5 , 0 ) DEFAULT NULL,
	`state`	text DEFAULT NULL,
	`date_scheduled`	date DEFAULT NULL,
	`date_plannedstart`	date DEFAULT NULL,
	`date_expectedready`	date DEFAULT NULL,
	`orderposition`	int ( 11 ) DEFAULT NULL,
	`ordersubposition`	int ( 11 ) DEFAULT NULL,
	`rawmatorder_state`	int ( 11 ) DEFAULT NULL,
	`date_rawmatorder`	date DEFAULT NULL,
	CONSTRAINT `fk_idrawmaterial_od` FOREIGN KEY(`idrawmaterial`) REFERENCES `rawmaterial`(`idrawmaterial`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idproduct_od` FOREIGN KEY(`idproduct`) REFERENCES `product`(`idproduct`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idorder_od` FOREIGN KEY(`idorder`) REFERENCES `order`(`idorder`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `order` (
	`idorder`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`ordertype`	text DEFAULT NULL,
	`idcustomer`	int ( 11 ) DEFAULT NULL,
	`idordercontact`	int ( 11 ) DEFAULT NULL,
	`date_order`	date DEFAULT NULL,
	`date_scheduled`	date DEFAULT NULL,
	`customer_orderno`	varchar ( 45 ) DEFAULT NULL,
	`customer_refdoc`	varchar ( 45 ) DEFAULT NULL,
	`internal_orderno`	varchar ( 45 ) DEFAULT NULL,
	`default_order_number`	varchar ( 45 ) DEFAULT NULL,
	`state`	text DEFAULT NULL,
	`iddeliverycontact`	int ( 11 ) DEFAULT NULL,
	`iddeliveryaddress`	int ( 11 ) DEFAULT NULL,
	`deliverytype`	varchar ( 45 ) DEFAULT NULL,
	`idinvoicecontact`	int ( 11 ) DEFAULT NULL,
	`idinvoiceaddress`	int ( 11 ) DEFAULT NULL,
	`comment_internal`	varchar ( 200 ) DEFAULT NULL,
	`comment_offer`	varchar ( 200 ) DEFAULT NULL,
	`comment_delivery`	varchar ( 200 ) DEFAULT NULL,
	`comment_invoice`	varchar ( 200 ) DEFAULT NULL,
	`date_offer`	date DEFAULT NULL,
	`date_planned_prodstart`	date DEFAULT NULL,
	`date_planned_delivery`	date DEFAULT NULL,
	`date_delivery`	date DEFAULT NULL,
	`date_done`	date DEFAULT NULL,
	`price_calc_sum_notax`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_set_sum_notax`	decimal ( 8 , 2 ) DEFAULT NULL,
	CONSTRAINT `fk_iddeliveryaddress_or` FOREIGN KEY(`iddeliveryaddress`) REFERENCES `companyaddress`(`idcompanyaddress`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_iddeliverycontact_or` FOREIGN KEY(`iddeliverycontact`) REFERENCES `companycontact`(`idcompanycontact`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idordercontact_or` FOREIGN KEY(`idordercontact`) REFERENCES `companycontact`(`idcompanycontact`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idinvoiceaddress_or` FOREIGN KEY(`idinvoiceaddress`) REFERENCES `companyaddress`(`idcompanyaddress`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idcustomer_or` FOREIGN KEY(`idcustomer`) REFERENCES `company`(`idcompany`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idinvoicecontact_or` FOREIGN KEY(`idinvoicecontact`) REFERENCES `companycontact`(`idcompanycontact`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `matorderdetail` (
	`idmatorderdetail`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idmatorder`	int ( 11 ) DEFAULT NULL,
	`idcustomer`	int ( 11 ) DEFAULT NULL,
