	`amount`	decimal ( 10 , 3 ) DEFAULT NULL,
	`amount_unit`	varchar ( 16 ) DEFAULT NULL,
	`date_delivery`	date DEFAULT NULL,
	`reference_name`	varchar ( 50 ) DEFAULT NULL,
	`position`	int ( 11 ) DEFAULT NULL,
