	CONSTRAINT `fk_idorderdetail_mod_1` FOREIGN KEY(`idorderdetail`) REFERENCES `orderdetail`(`idorderdetail`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idcustomer_mod_1` FOREIGN KEY(`idcustomer`) REFERENCES `company`(`idcompany`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idmatorder_mod_1` FOREIGN KEY(`idmatorder`) REFERENCES `matorder`(`idmatorder`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `matorder` (
	`idmatorder`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
