	CONSTRAINT `fk_idsuppliercontact_mo` FOREIGN KEY(`idsuppliercontact`) REFERENCES `companycontact`(`idcompanycontact`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idsupplier_mo` FOREIGN KEY(`idsupplier`) REFERENCES `company`(`idcompany`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `invoicedetail` (
	`idinvoicedetail`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idorderdetail`	int ( 11 ) DEFAULT NULL,
	`idinvoice`	int ( 11 ) DEFAULT NULL,
