CREATE TABLE IF NOT EXISTS `delivery` (
	`iddelivery`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idorder`	int ( 11 ) DEFAULT NULL,
	`number`	varchar ( 45 ) DEFAULT NULL,
	`date`	date DEFAULT NULL,
	`idshipper`	int ( 11 ) DEFAULT NULL,
	`comment`	varchar ( 200 ) DEFAULT NULL,
	`iddeliveryaddress`	int ( 11 ) DEFAULT NULL,
	`iddeliverycontact`	int ( 11 ) DEFAULT NULL,
	CONSTRAINT `fk_idshipper_dy` FOREIGN KEY(`idshipper`) REFERENCES `shipper`(`idshipper`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idorder_dy` FOREIGN KEY(`idorder`) REFERENCES `order`(`idorder`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `conforderdetail` (
	`idconforderdetail`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idorderdetail`	int ( 11 ) DEFAULT NULL,
	`idconforder`	int ( 11 ) DEFAULT NULL,
	`amount`	decimal ( 8 , 2 ) DEFAULT NULL,
	`amount_unit`	varchar ( 16 ) DEFAULT NULL,
	`name`	varchar ( 100 ) DEFAULT NULL,
	`supplier_prodno`	varchar ( 45 ) DEFAULT NULL,
	`supplier_drawno`	varchar ( 45 ) DEFAULT NULL,
	`comment`	varchar ( 200 ) DEFAULT NULL,
	`orderposition`	int ( 11 ) DEFAULT NULL,
	`ordersubposition`	int ( 11 ) DEFAULT NULL,
	`price_per_piece_notax`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_initial_notax`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_set_per_piece_notax`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_sum_notax`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_average_per_piece`	decimal ( 8 , 2 ) DEFAULT NULL,
	`tax`	decimal ( 5 , 2 ) DEFAULT NULL,
	`date_scheduled`	date DEFAULT NULL,
	CONSTRAINT `fk_idconforder_cod` FOREIGN KEY(`idconforder`) REFERENCES `conforder`(`idconforder`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idorderdetail_cod` FOREIGN KEY(`idorderdetail`) REFERENCES `orderdetail`(`idorderdetail`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `conforder` (
	`idconforder`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idconforderaddress`	int ( 11 ) DEFAULT NULL,
	`idconfordercontact`	int ( 11 ) DEFAULT NULL,
	`idorder`	int ( 11 ) DEFAULT NULL,
	`number`	varchar ( 45 ) DEFAULT NULL,
	`comment`	varchar ( 200 ) DEFAULT NULL,
	`state`	text DEFAULT NULL,
	`price_sum`	decimal ( 8 , 2 ) DEFAULT NULL,
	`reduction1`	decimal ( 5 , 2 ) DEFAULT NULL,
	`price_reduction1`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_after_red1`	decimal ( 8 , 2 ) DEFAULT NULL,
	`reduction2`	decimal ( 5 , 2 ) DEFAULT NULL,
	`price_reduction2`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_after_red2`	decimal ( 8 , 2 ) DEFAULT NULL,
	`text_delivery`	varchar ( 60 ) DEFAULT NULL,
	`price_delivery`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_sum_notax`	decimal ( 8 , 2 ) DEFAULT NULL,
	`tax`	decimal ( 5 , 2 ) DEFAULT NULL,
	`price_tax`	decimal ( 8 , 2 ) DEFAULT NULL,
	`price_sum_tax`	decimal ( 8 , 2 ) DEFAULT NULL,
	`confordercode`	varchar ( 60 ) DEFAULT NULL,
	`payment_custom_text`	varchar ( 60 ) DEFAULT NULL,
	`date_conforder`	date DEFAULT NULL,
	`title`	varchar ( 60 ) DEFAULT NULL,
	CONSTRAINT `fk_idconfordercontact_co_1` FOREIGN KEY(`idconfordercontact`) REFERENCES `companycontact`(`idcompanycontact`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idconforderaddress_co_1` FOREIGN KEY(`idconforderaddress`) REFERENCES `companyaddress`(`idcompanyaddress`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idorder_co_1` FOREIGN KEY(`idorder`) REFERENCES `order`(`idorder`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `config` (
	`idconfig`	int ( 11 ) NOT NULL,
	`dbversion`	decimal ( 4 , 2 ) DEFAULT '1.00',
	`default_tax`	decimal ( 5 , 2 ) DEFAULT '8.00',
	`docpath_win`	varchar ( 500 ) DEFAULT NULL,
	`docpath_linux`	varchar ( 500 ) DEFAULT NULL,
	`docpath_mac`	varchar ( 500 ) DEFAULT NULL,
	`docpath_custom`	varchar ( 500 ) DEFAULT NULL
);
CREATE TABLE IF NOT EXISTS `companycontact` (
	`idcompanycontact`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idcompany`	int ( 11 ) DEFAULT NULL,
	`idcompanyaddress`	int ( 11 ) DEFAULT NULL,
	`title`	varchar ( 45 ) DEFAULT NULL,
	`firstname`	varchar ( 45 ) DEFAULT NULL,
	`familiyname`	varchar ( 45 ) DEFAULT NULL,
	`phone`	varchar ( 45 ) DEFAULT NULL,
	`fax`	varchar ( 45 ) DEFAULT NULL,
	`mail`	varchar ( 45 ) DEFAULT NULL,
	`state`	text DEFAULT NULL,
	`name_full`	varchar ( 100 ) DEFAULT NULL,
	CONSTRAINT `fk_idcompanyaddress_cc` FOREIGN KEY(`idcompanyaddress`) REFERENCES `companyaddress`(`idcompanyaddress`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idcompany_cc` FOREIGN KEY(`idcompany`) REFERENCES `company`(`idcompany`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `companyaddress` (
	`idcompanyaddress`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`idcompany`	int ( 11 ) DEFAULT NULL,
	`specificname1`	varchar ( 60 ) DEFAULT NULL,
	`specificname2`	varchar ( 60 ) DEFAULT NULL,
	`address1`	varchar ( 45 ) DEFAULT NULL,
	`address2`	varchar ( 45 ) DEFAULT NULL,
	`zip`	varchar ( 45 ) DEFAULT NULL,
	`city`	varchar ( 45 ) DEFAULT NULL,
	`country`	varchar ( 45 ) DEFAULT NULL,
	`phonelocation`	varchar ( 45 ) DEFAULT NULL,
	`maillocation`	varchar ( 45 ) DEFAULT NULL,
	`faxlocation`	varchar ( 45 ) DEFAULT NULL,
	`idfavoriteshipper`	int ( 11 ) DEFAULT NULL,
	`languagecode`	varchar ( 10 ) DEFAULT NULL,
	CONSTRAINT `fk_idcompany_ca` FOREIGN KEY(`idcompany`) REFERENCES `company`(`idcompany`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT `fk_idfavoriteshipper_ca` FOREIGN KEY(`idfavoriteshipper`) REFERENCES `shipper`(`idshipper`) ON DELETE NO ACTION ON UPDATE NO ACTION
);
CREATE TABLE IF NOT EXISTS `company` (
	`idcompany`	integer NOT NULL PRIMARY KEY AUTOINCREMENT,
	`type`	text DEFAULT NULL,
	`name`	varchar ( 60 ) DEFAULT NULL,
	`taxno`	varchar ( 25 ) DEFAULT NULL,
	`abbreviation`	varchar ( 10 ) DEFAULT NULL,
	`logofile`	varchar ( 45 ) DEFAULT NULL
);
